          "format": "table",
          "rawQuery": true,
          "rawSql": "select \r\n\ts1.`position`  as 'Top300 _1',\r\n\ts2.`position` as 'Top300_2',\r\n\t(s2.`position` - s1.`position`) as 'TOP300_2 - TOP300_1',\r\n\ts1.name as \"Name 1\",\r\n\ts2.name as \"Name 2\",\r\n\ts1.alliance as \"Alliance 1\",\r\n\ts2.alliance as \"Alliance 2\",\r\n\ts1.power as \"POW 1\",\r\n\ts2.power as \"POW 2\",\r\n\t(s2.power -s1.power) as \"POW2 - POW1\",\r\n\ts1.kp as \"KP 1\",\r\n\ts2.kp as \"KP 2\",\r\n\ts2.kp - s1.kp as \"KP2 - KP1\",\r\n\ts1.deaths as \"DEATHS 1\",\r\n\ts2.deaths as \"DEATHS 2\",\r\n\ts2.deaths -s1.deaths as \"D2 - D1\",\r\n\ts1.t4_kills as \"T4 KILLS 1\",\r\n\ts2.t4_kills as \"T4 KILLS 2\",\r\n\ts2.t4_kills - s1.t4_kills as \"T4_2 - T4_1\",\r\n\ts1.t5_kills as \"T5 KILLS 1\",\r\n\ts2.t5_kills as \"T5 KILLS 2\",\r\n\ts2.t5_kills - s1.t5_kills as \"T5_2 - T5_1\",\r\n\t(s1.kp/s1.power) as \"KP/POW 1\",\r\n\t(s2.kp/s2.power) as \"KP/POW 2\",\r\n\t(s2.kp/s2.power) - (s1.kp/s1.power) as \"KP/P2 - KP/P1\" \r\n\r\nfrom \r\n(select * from scandata s where idscan in (select idscan from scans WHERE kd=$kd_list and scan_time = '$comp_1' )) s1 \r\nLEFT join (select * from scandata s where idscan in (select idscan from scans WHERE kd=$kd_list and scan_time='$comp_2' )) s2 on s1.playerid =s2.playerid \r\nORDER BY s1.power desc",
